import styled, {css} from 'styled-components'

export const Dotbutton =styled.button` 
    border:none;
    position: relative;
    width:15px;
    height:15px;
    border-radius:20px;
    top:200px;
    cursor:pointer;
    margin-top: 30px;
    left:500px;

    ${ props => props.Color.$ === 'prevClick' && css`
    background-color: #929292;
    `}
    ${ props => props.Color.$ === 'Clicked' && css`
    background-color: black;
    `}
    `;
